#import sqlite3 to use as a database:
import sqlite3
  
def createDatabase():
    #Use sqlite3 to create NavyPFA_DB database:
    connection = sqlite3.connect('NavyPFA_DB.db')
    #create cursor to execute methods:
    cursor = connection.cursor()
        
    # SQL command to create a table in the database
    create_table = """CREATE TABLE IF NOT EXISTS PFA_STANDARDS (
    Gender TEXT,
    Age_Group TEXT,
    Performance TEXT, 
    Points INTEGER,
    Push_Ups TEXT,
    Forearm_Planks TEXT,
    One_and_Half_Mile_Run TEXT,
    Two_Kilometer_Row TEXT,
    FourHundredFifty_Meter_Swim TEXT,
    FiveHundred_Yard_Swim TEXT,
    Stationary_Bike TEXT,
    Treadmill TEXT);"""
    #Execute the statement:
    cursor.execute(create_table)
    #Commit entries to save to SQL database:
    connection.commit()

